import React from "react";
import { Link,useHistory } from "react-router-dom";


const Header = () => {

    return(
      <div>
        <div className="ui inverted segment">
        <div className="ui inverted secondary pointing menu">
            <Link to="/list"> <div className="ui item"><h4>Home</h4></div></Link>
            <Link to="/add"> <div className="ui item"><h4>Create</h4></div></Link>


        </div>
        </div>
        <div align="center" style={{margin:"30px",display:"flex",justifyContent:"center"}}>
        <h1>NotesList React Application</h1>
        <i className="backward icon" onClick={() => {useHistory.goBack()}}> </i>
    </div>
    </div>

    );
}

export default Header;
